import { jsPDF } from "jspdf";

const font = '';

const callAddFont = function () {
    // @ts-ignore
    this.addFileToVFS('Vazirmatn-VariableFont_wght-normal.ttf', font);
    // @ts-ignore
    this.addFont('Vazirmatn-VariableFont_wght-normal.ttf', 'Vazirmatn-VariableFont_wght', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont]);

export { callAddFont };
